import React from 'react';
import './Home.css';

const Home = () => {
  return (
    <div className="home">
      <h1>Welcome to Aruj's World <br> Expoloe</br></h1>

      <p>Explore my journey, achievements, and career aspirations!</p>
    </div>    
  );
};

export default Home;
